import React from 'react'

function fileupload() {
    const uploadfile=(e)=>{
        const file=e.target.files
        console.log("files",file)
    }
    return (
        <div>
            <h>File Upload</h>
            <br/>
            <div>
                <input type="file" onChange={(e)=>uploadfile}/>

            </div>
        </div>
    )
}

export default fileupload
